class Solution {
public:
    int f(int curr,int prev,vector<int>& nums,int n){
        int t=nums[curr]+nums[prev];
        auto it = lower_bound(nums.begin(),nums.end(),t);
        if(it!=nums.end() && *it==t) return 1+f(distinct(curr,prev),curr,nums,n);
        return 1;
    }

    int lenLongestFibSubseq(vector<int>& nums) {
        int n=nums.size();
        int maxi=0;
        for(int prev2=0;prev2<n;prev2++){
            for(int prev1=prev2+1;prev1<n;prev1++){
                int temp=nums[prev1]+nums[prev2];
                auto it = lower_bound(nums.begin(),nums.end(),temp);
                if(it!=nums.end() && *it==temp) maxi=max(maxi,2+f(distinct(prev2,prev1),prev1,nums,n));
            }
        }
        return maxi;
    }

    int distinct(int a, int b){
        return (a<b)? a : b;
    }
};

