    unordered_map<int,int> x, freqCount;
    void add(int number){ 
        x[number]++;
        if(x.count(number)!=1) freqCount[x[number]-1]--;
        freqCount[x[number]]++;
    }
    void deleteOne(int number){ 
        if(x.count(number)!=0){
            x[number]--;
            freqCount[x[number]+1]--;
            freqCount[x[number]]++;
        }
    }
    bool hasFrequency(int frequency){ 
        return freqCount.count(frequency)!=0;
    };

