class Solution {
public:
    int findTargetSumWays(vector<int>& nums, int target) {
        // idx, sum -> no of ways
        map<pair<int, int>, int> memo;
        return dp(nums, target, 0, 0, memo); 
    }

private:
    int dp(vector<int>& nums, int target, int idx, int sum, map<pair<int, int>, int>& memo) {
        if (idx == nums.size()) return target == sum ? 1 : 0;
        if (memo.count({idx, sum})) return memo[{idx, sum}];

        int ways = dp(nums, target, idx + 1, sum + nums[idx], memo);
        ways += dp(nums, target, idx + 1, sum - nums[idx], memo);

        return memo[{idx, sum}] = ways;
    }
};

