        return helper(arr, 0, arr.size(), n); 
    } 

    int helper(vector<int>& arr, int i, int n, int sum) { 
        if (sum == 0) return 0; 
        if (i >= n || sum < 0) return INT_MAX - 1000; 
        if (dp[i][sum] != -1) return dp[i][sum]; 
        int mini = INT_MAX; 
        if (arr[i] <= sum) mini = min(mini, 1 + helper(arr, i, n, sum - arr[i])); 
        mini = min(mini, helper(arr, i + 1, n, sum)); 
        return dp[i][sum] = mini; 
    } 

    int dp[105][10005]; 
};

