public:
    vector<int> maximumBeauty(vector<vector<Integer>>& items, vector<int>& queries) {
        sort(items.begin(), items.end());
        vector<int> ans, beauty(items.size());

        for(int i = 0; i < items.size(); i++) {
            if(i == 0) beauty[i] = items[i][1];
            else beauty[i] = max(beauty[i-1], items[i][1]);
        }

        for(int i : queries) ans.push_back(lower_bound(beauty.begin(), beauty.end(), i) - beauty.begin());
